// src/components/HeroSection.js
import React from 'react';

const HeroSection = () => (
  <section className="relative flex flex-col items-center justify-center h-96 bg-gray-100 text-center">
    <img src="https://via.placeholder.com/1440x825" alt="Hero" className="absolute inset-0 w-full h-full object-cover" />
    <div className="relative z-10 p-8 bg-opacity-75 bg-gray-800 text-white rounded-md max-w-2xl">
      <h2 className="text-3xl font-bold mb-4">We Are One People, One Nation.</h2>
      <p className="text-lg mb-6">
        We are a community where you can meet like-minded women and enjoy the company of so many others just like you!
      </p>
      <button className="bg-green-500 text-white font-bold py-2 px-4 rounded-full">
        Join Our Community
      </button>
    </div>
  </section>
);

export default HeroSection;
